description:
bán đất tặng nhà -  liền kề thấp tầng _khu đô thị sudico – nam an khánh -  dãy tt15 - 301m2 – 115 tr/m2 
mô tả:
- dự án nam an khánh, đường láng hòa lạc, xã an khánh, hoài đức, hà nội;
- hướng đông - mặt tiền rộng 7.5m - đường trước nhà 13m - sau nhà mặt đường liên khu 8 - cổng chính hado charm villas;
- lô đất diện tích: 301m2,  đã có nhà  xây thô 3 tầng hoàn thiện mặt ngoài;
- phù hợp mở nhà hàng, café sân vườn (có 120m2 sân vườn đằng sau);
- nằm vị trí trung tâm của dự án. gần hồ điều hoà, công viên trung tâm outlet;
  giá: 115tr/1m2 ( bán đất tặng nhà đã xây thô hoàn thiện mặt ngoài)
 sổ đỏ chính chủ, sẵn sàng giao dịch.
☎ liên hệ: mr hoàng diệu. hotline: 0986.493.919/zalo
